import classes from "../AboutUs.module.css";
import UkrainianLocation from "../UkrainianLocation";
import UkrainianNatureNear from "../UkrainianNatureNear";
import UkrainianOwnFarm from "../UkrainianOwnFarm";
import ContentPageAnimation from "../ContentPageAnimation";
function UkrainianAboutUsPage() {
  return (
        <div className={classes.wrapper}>
          <ContentPageAnimation>
          <UkrainianLocation />
          <UkrainianNatureNear />
          <UkrainianOwnFarm />
          </ContentPageAnimation>
        </div>
  );
}
export default UkrainianAboutUsPage;
